<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    
    <meta http-equiv="Cache-Control" content="no-cache, no-store, must-revalidate">
    <meta http-equiv="Pragma" content="no-cache">
    <meta http-equiv="Expires" content="0">

    <title>Chess Puzzles</title>
    <style>
        body {
            background-color: #000000;
            color: #bababa;
            font-family: -apple-system, system-ui, BlinkMacSystemFont, "Segoe UI", Roboto, Helvetica, Arial, sans-serif;
            display: flex;
            flex-direction: column;
            align-items: center;
            /* Aligns to top instead of center to fix the "low" appearance */
            justify-content: flex-start; 
            height: 100vh;
            margin: 0;
            /* Moves the box down slightly from the very top for better balance */
            padding-top: 8vh; 
        }

        h1 { 
            color: #fff; 
            margin-top: 0; 
            margin-bottom: 1.5rem; 
            font-size: 1.8rem;
            font-weight: 600;
            letter-spacing: 1.5px;
            text-transform: uppercase;
        }

        .menu-card {
            background-color: #1c1a17; /* Darker charcoal */
            padding: 2rem;
            border-radius: 12px;       /* Slightly smoother corners */
            box-shadow: 0 10px 30px rgba(0,0,0,0.8); /* Deeper shadow for depth */
            border: 1px solid #312e2b; /* Subtle border to define the edge */
            text-align: center;
            max-width: 450px;
            width: 90%;
        }


        .button-grid {
            display: grid;
            grid-template-columns: 1fr 1fr;
            gap: 15px;
        }

        button {
            padding: 18px;
            font-size: 1.1rem;
            font-weight: 800;
            cursor: pointer;
            border-radius: 6px;
            border: none;
            color: white;
            transition: all 0.2s ease;
            
            /* This creates the "Raised" 3D effect */
            border-bottom: 4px solid rgba(0, 0, 0, 0.3);
            text-shadow: 0px 1px 2px rgba(0, 0, 0, 0.5);
        }

        /* Specific Glows for each color */
        .btn-easy { 
            background-color: #629924; 
            box-shadow: 0 0 15px rgba(98, 153, 36, 0.4); 
        }
        .btn-medium { 
            background-color: #d5a021; 
            box-shadow: 0 0 15px rgba(213, 160, 33, 0.4); 
        }
        .btn-hard { 
            background-color: #b33939; 
            box-shadow: 0 0 15px rgba(179, 57, 57, 0.4); 
        }
        .btn-mate { 
            background-color: #b0b0b0; 
            color: #161512;
            box-shadow: 0 0 15px rgba(255, 255, 255, 0.2); 
        }
        .btn-random { 
            background-color: #444444; 
            grid-column: span 2; 
            margin-top: 10px;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.5);
        }

        /* Hover: Increase the glow */
        button:hover {
            filter: brightness(1.1);
            box-shadow: 0 0 25px rgba(255, 255, 255, 0.1);
            transform: translateY(-2px); /* Lifts up slightly on hover */
        }

        /* Active: The "Press" effect */
        button:active {
            filter: brightness(0.9);
            transform: translateY(2px); /* Moves down to simulate a click */
            border-bottom: 0px; /* Flattens the 3D edge */
        }
        
    </style>
</head>

    <div class="menu-card">
        <h1>CHESS PUZZLES</h1>
        <div class="button-grid">
            <button class="btn-easy" onclick="launch('level2')">EASY</button>
            <button class="btn-medium" onclick="launch('level3')">MEDIUM</button>
            <button class="btn-hard" onclick="launch('level4')">HARD</button>
            <button class="btn-mate" onclick="launch('mate_in_2')">MATE IN 2</button>
            <button class="btn-random" onclick="launch('random')">ðŸ”€ RANDOM</button>
        </div>
    </div>

                const chapter = study[1][entropy[2] % study[1].length];
